(1058, 'non', 'non', 'non', 'non', 'mail', 'immediate', 1654552800, 'cheque', 1654596532, '10h', '11h', 443, 260, 'Intervention sur deux jours : le vendredi 3 juin et le mardi 7 juin.\r\n\r\nUne première tentative d\'ouverture du logiciel indiquait que la communication avec l\'ordinateur fixe était impossible.\r\n\r\nAprès avoir effectué un ping vers le nom de l\'ordinateur, nous nous sommes rendus compte que l\'adresse IP résolue ne correspondait pas à celle configuré sur l\'ethernet de l\'ordinateur. L\'ordinateur fixe dispose de deux interfaces, une interface Ethernet, et une interface Wifi, toutes les deux sur le même réseau. L\'interface Wifi n\'est plus utilisée.\r\n\r\nLa résolution du nom de l\'ordinateur fixe retournait l\'adresse IP du Wifi, au lieu de celle de l\'Ethernet. Nous avons donc modifié dans les paramètres de la Livebox, qui fait office de serveur DNS, le nom associé à l\'adresse MAC de la carte Ethernet de l\'ordinateur, afin que celui-ci résolve l\'adresse IP de l\'Ethernet au lieu du Wifi.\r\nAprès ces manipulations, le logiciel métier fonctionne désormais comme il faut.', 'non', 1),
